import React from 'react';
import 'antd/dist/antd.css';
import PropTypes from 'prop-types';

const App = ({Component}) => {

    return(
        <Component/>
    )
}

App.propTypes = {
    Component: PropTypes.elementTypes.isRequired,
}

export default App;
